import React from 'react';
import styled from 'styled-components'

function App(props) {

  const Cat = styled.button`
    background: brown;
    width: 120px;
    height: 40px;
    border-radius: 30px;
    font-family: Arial;
`;

  return (
    <div>
        <Cat>TEST</Cat>
    </div>
  )
}

export default App;
